using System.Windows.Media.Imaging;

namespace Medo.Windows {

    /// <summary>
    /// Displays a window that can contain text that inform and instruct the user.
    /// </summary>
    public static class MessageWindow {

        /// <summary>
        /// Displays a windows with specified text.
        /// </summary>
        /// <param name="owner">Owner window.</param>
        /// <param name="text">Text.</param>
        public static void ShowInformation(Window owner, string text) {
            Show(owner, text, InformationIcon.Value, false, false, true);
        }

        /// <summary>
        /// Displays a windows with specified text.
        /// </summary>
        /// <param name="owner">Owner window.</param>
        /// <param name="text">Text.</param>
        public static void ShowWarning(Window owner, string text) {
            Show(owner, text, WarningIcon.Value, false, false, true);
        }

        /// <summary>
        /// Displays a windows with specified text.
        /// </summary>
        /// <param name="owner">Owner window.</param>
        /// <param name="text">Text.</param>
        public static void ShowError(Window owner, string text) {
            Show(owner, text, ErrorIcon.Value, false, false, true);
        }

        /// <summary>
        /// Displays a windows with question that requires only Yes and No as answers.
        /// Returns true if user selected yes and false if no was selected.
        /// </summary>
        /// <param name="owner">Owner window.</param>
        /// <param name="text">Text.</param>
        public static bool ShowQuestion(Window owner, string text) {
            return Show(owner, text, QuestionIcon.Value, true, true, false).Value;
        }


        private static bool? Show(Window owner, string text, ImageSource image, bool showYes, bool showNo, bool showOk) {
            Image icon = new Image() { Width = 32, Height = 32, Margin = new Thickness(0, 0, 7, 0), VerticalAlignment = VerticalAlignment.Top, Source = image };

            TextBlock textBlock = new TextBlock() { TextWrapping = TextWrapping.WrapWithOverflow, MaxWidth = 480 };
            textBlock.Text = text;

            var contentStack = new StackPanel() { Orientation = Orientation.Horizontal, Margin = new Thickness(11) };
            contentStack.Children.Add(icon);
            contentStack.Children.Add(textBlock);

            var window = new Window() { FontFamily = SystemFonts.MessageFontFamily, FontSize = SystemFonts.MessageFontSize, FontWeight = SystemFonts.MessageFontWeight, MinWidth = 200, Background = SystemColors.ControlBrush };

            var buttonStack = new StackPanel() { Orientation = Orientation.Horizontal, Margin = new Thickness(0, 11, 11, 11), HorizontalAlignment = HorizontalAlignment.Right };
            if (showYes) {
                var buttonYes = new Button() { Content = Localizations.Yes, Width = 75, Height = 23, Margin = new Thickness(7, 0, 0, 0), Tag = window };
                buttonYes.Click += new RoutedEventHandler(ButtonResultTrue_Click);
                buttonStack.Children.Add(buttonYes);
                buttonYes.Focus();
            }
            if (showNo) {
                var buttonNo = new Button() { Content = Localizations.No, Width = 75, Height = 23, Margin = new Thickness(7, 0, 0, 0), IsCancel = true, Tag = window };
                buttonNo.Click += new RoutedEventHandler(ButtonResultFalse_Click);
                buttonStack.Children.Add(buttonNo);
            }
            if (showOk) {
                var buttonOk = new Button() { Content = Localizations.Ok, Width = 75, Height = 23, Margin = new Thickness(7, 0, 0, 0), IsCancel = true, IsDefault = true, Tag = window };
                buttonStack.Children.Add(buttonOk);
                buttonOk.Focus();
            }

            var windowStack = new StackPanel();
            windowStack.Children.Add(new Border() { Child = contentStack, Background = SystemColors.WindowBrush });
            windowStack.Children.Add(buttonStack);

            if (owner != null) {
                window.Icon = owner.Icon;
                window.Owner = owner;
                window.ShowInTaskbar = false;
                if (owner.Topmost) { window.Topmost = true; }
                window.WindowStartupLocation = WindowStartupLocation.CenterOwner;
                window.Title = owner.Title;
            } else {
                window.Icon = GetAppIcon(Assembly.GetEntryAssembly());
                window.Owner = null;
                window.ShowInTaskbar = true;
                window.WindowStartupLocation = WindowStartupLocation.CenterScreen;
                window.Title = GetAppTitleText(Assembly.GetEntryAssembly());
            }
            window.ResizeMode = ResizeMode.NoResize;
            window.ShowActivated = true;
            window.SizeToContent = SizeToContent.WidthAndHeight;
            window.Content = windowStack;
            return window.ShowDialog();
        }

        private static void ButtonResultTrue_Click(object sender, RoutedEventArgs e) {
            var button = (Button)sender;
            var window = (Window)button.Tag;
            window.DialogResult = true;
        }

        private static void ButtonResultFalse_Click(object sender, RoutedEventArgs e) {
            var button = (Button)sender;
            var window = (Window)button.Tag;
            window.DialogResult = false;
        }


